import React, { Component } from 'react'
import axios from 'axios'

import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';



export default class Weather extends Component {

    //Define state default values
    state = {
        data: []
    };

    //data={this.state.data}

     //Component Lifecycle Callback
    componentDidMount() {
        axios.get(`https:api.openweathermap.org/data/2.5/weather?q=Toronto&appid=0075d6a7c0a4afa060d8299f822f958f`)
        .then(response => {
            let details = [];

            for (var i in response.data) {
                details.push({ name: i, value: response.data[i] })
            }
            console.log(details)
            this.setState({ data: details })
        });
    }


    render() {

        return (
            <Container className="container-fluid">

                <h1 className="text-center">User List</h1>
                {this.state.data.map (w =>
                        <div className="col-lg-auto btn-info">
                            <b>{w.coord.lon} {w.coord.lat}</b>
                            <p>{w.coord.lon}</p>
                        </div>
                    )}
            </Container>
        )
    }

}
